import { Suspense, lazy } from 'react'; // Import Suspense and lazy
import { Routes, Route } from 'react-router-dom'; // Import Routes and Route

// Dynamically import components
const LoginSignup = lazy(() => import('./LoginSignup')); // Lazily load the LoginSignup component
const AdminDashboard = lazy(() => import('./admin/AdminDashboard'));
const Chat = lazy(() => import('./user/chat'));

export default function App() {
  return (
    <div>
      <Suspense fallback={<div>Loading...</div>}>
        <Routes>
          {/* Define routes */}
          <Route path="/" element={<LoginSignup />} />
          <Route path="/admin" element={<AdminDashboard />} />
          <Route path="/chat" element={<Chat />} />
          <Route path="/login" element={<LoginSignup />} /> {/* Redirect to LoginSignup */}
          {/* Add more routes as necessary */}
        </Routes>
      </Suspense>
    </div>
  );
}
